import styled from "styled-components";

const Stepper = styled.div`
    display: flex;
    height: 3rem;
    border-bottom: none;
    margin-top: 2rem;
    align-items: center;
    border-radius: 1rem 1rem 0 0;
    position: relative;

    @media only screen and (max-width: 768px) {
        font-size: 0.5rem;
        height: 2rem;
    }
`;

export default Stepper;
